import './card.css';

function Card({ razas }) {
   const { name, image, life_span, weight } = razas

   return (
      <div className='card'>
         <h2>{name}</h2>
         <p src={image} alt={name} />
         <p>{life_span}</p>
         <p>{weight}</p>
      </div>
   );
}

export default Card;
